import React, { useState } from 'react'
import "./username.css"

const UserName = () => {
    const[name,setname]=useState('akhilesh')
    const[email,setmail]=useState('akhilesh@gmail.com')

  return (
    <>
    <div id='cnt'>
    <div id='tmp'>
      <span>{name}</span>
      <span>{email}</span>
      <span>time</span>
    </div>
    </div>
    </>
  )
}

export default UserName
